using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace LeetCode.Question
{
	/// <summary>
	/// 给你一个字符串 s 、一个字符串 t 。返回 s 中涵盖 t 所有字符的最小子串。如果 s 中不存在涵盖 t 所有字符的子串，则返回空字符串 "" 。
	/// </summary>
	/// <remarks>注意：如果 s 中存在这样的子串，我们保证它是唯一的答案。</remarks>
	public class Q76 : IQuestion
	{
		public string MinWindow(string s, string t)
		{
			string minStr = s;
			bool hasAns = false;
			int[] dic = new int[26 * 2];
			int[] need = new int[26 * 2];
			foreach (var ch in t)
			{
				need[CharToPos(ch)]++;
			}
			int begin = 0;
			for (int i = 0; i < s.Length; i++)
			{
				if (t.Contains(s[i]))
				{
					if (dic[CharToPos(s[i])] < need[CharToPos(s[i])])
					{
						bool isAll = true;
						dic[CharToPos(s[i])]++;
						foreach (var ch in t)
						{
							if (dic[CharToPos(ch)] < need[CharToPos(ch)])
							{
								isAll = false;
								break;
							}
						}
						if (isAll)
						{
							for (int j = begin; j <= i - t.Length + 1; j++)
							{
								if (need[CharToPos(s[j])] != 0)
									if (dic[CharToPos(s[j])] == need[CharToPos(s[j])])
									{

										if (i - j < minStr.Length)
										{
											minStr = s.Substring(j, i - j + 1);
											hasAns = true;
										}
										begin = j + 1;
										dic[CharToPos(s[j])]--;
										break;
									}
									else
									{
										dic[CharToPos(s[j])]--;
									}
							}
						}
					}
					else
					{
						dic[CharToPos(s[i])]++;
					}
				}
			}
			return hasAns ? minStr : "";
			int CharToPos(char ch)
			{
				return ch < 'a' ? ch - 'A' : ch - 'a' + 26;
			}
		}
		public void Go()
		{
			Console.WriteLine(MinWindow("ADOBECODEBANC", "ABC"));
			Console.WriteLine(MinWindow("a", "a"));
			Console.WriteLine(MinWindow("a", "aa"));
			Console.WriteLine(MinWindow(""
, ""));
		}
	}
}
